dynamic(
    // @ts-ignore
  () => {
        // @ts-ignore

    import('webrtc-adapter')
    import('aframe')
    // @ts-ignore
    import('networked-aframe')
        // @ts-ignore
    import('naf-janus-adapter/dist/naf-janus-adapter')
  },
  { ssr: false }
)


export default class LocalScene {
    render() {
        return (
            <div >
                <a-scene renderer="antialias: true" background="color: #FAFAFA">
                    <a-box
                        position="-1 0.5 -3"
                        rotation="0 45 0"
                        color="#4CC3D9"
                        shadow
                    ></a-box>
                </a-scene>
            </div>
        )
    }
}
